import React from 'react'
import { NavLink } from 'react-router-dom'

export default function Navbar() {
    return (
        <nav>
            <NavLink to={'/'} className='title'>
                <h1>Lapchess</h1>
            </NavLink>

            <div className='gameOptions'></div>
        </nav>
    )
}
